import React from 'react';
import { Link } from "react-router-dom";
import "./Navigation.css";

function Navigation() {
    return (
        <header className="nav">
            <Link to="/">Home</Link>
            <Link to="/about">About</Link>
            <Link to="/brand">Brand</Link>
        </header>
    );

}
export default Navigation;
